data_model.html.body:
Signal K Data ModelFormatsSignal K defines two data formats, full and delta, for representing and transmitting data.In addition the 'sparse'
format is the same as the full format, but doesn't contain a full tree, just parts of the full tree.Full formatThe simplest format is the full format, which is the complete Signal K data model  as a JSON string.{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "version": "0.1",
      "name": "motu",
      "mmsi": "2345678",
      "source": "self",
      "timezone": "NZDT",
      "navigation": {
        "state": {
          "value": "sailing",
          "source": "self",
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "headingTrue": {
          "value": 2.3114,
          "$source": "nmea0183-1.II",
          "sentence": "HDT",
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "speedThroughWater": {
          "value": 2.556,
          "$source": "n2k-1.160",
          "pgn": 128259,
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "position": {
          "longitude": 23.53885,
          "latitude": 60.0844,
          "$source": "nmea0183-2.GP",
          "timestamp": "2014-03-24T00:15:42Z",
          "sentence": "GLL"
        }
      }
    }
  }
}
The message is UTF-8 ASCII text, and the top-level attribute(key) is always "vessels". Below this level is a list of
vessels, identified by their MMSI number or a generated unique id. There may be many vessels, if data has been received
from AIS or other sources. The format for each vessel's data uses the same standard Signal K structure, but may not have
the same content, i.e. you won't have as much data about other vessels as you have about your own.The values are always SI units, and always the same units for the same key. I.e. speedOverGround is always meters per
second, never knots, km/hr, or miles/hr. This means you never have to send 'units' with data, the units are specific for
a key, and defined in the data schema. A simplified version of the JSON schema with the units is available in Keys Reference in Appendix A.The ordering of keys is also not important, they can occur in any order. In this area Signal K follows normal JSON
standards.The full format is useful for backups, and for populating a secondary device, or just updating all data, a kind of 'this
is the current state' message.However sending the full data model will be wasteful of bandwidth and CPU, when the majority of data does not change
often. So we want to be able to send parts of the model (i.e. parts of the hierarchical tree).Delta formatWhile building the reference servers and clients it was apparent that a third type of message format was useful. This
format specifically sends changes to the full data model. This was useful for a number of technical reasons, especially
in clients or sensors that did not hold a copy of the data model.The format looks like this (pretty printed):{
    "context": "vessels.urn:mrn:imo:mmsi:234567890",
    "updates": [{
        "source": {
            "type": "NMEA2000",
            "src": "017",
            "pgn": 127488,
            "label": "N2000-01.017"
        },
        "timestamp": "2010-01-07T07:18:44Z",
        "values": [{
            "path": "propulsion.0.revolutions",
            "value": 16.341667
        }, {
            "path": "propulsion.0.boostPressure",
            "value": 45500.0
        }]
    }]
}
In more detail we have the header section:{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [
    ...data goes here...
  ]
}
A delta message can be recognised from the other types by the topmost level having updates property.
updates is the only required property.
If context is missing it is assumed that the data is related to the self context.Context is a path from the root of the full tree to the container object, which for vessel related data must refer to the vessel directly under vessels.
The delimiter in the context path is . (period).
In this case the context is vessels.urn:mrn:imo:mmsi:234567890.
All subsequent data is relative to that location.The updates holds an array (JSON array) of updates, each of which has a source and a JSON array of values.{
  "source": {
    "device": "/dev/actisense",
    "src": "115",
    "pgn": "128267"
  },
  "timestamp": "2014-08-15-16:00:00.081",
  "values": [
    {
      "path": "navigation.courseOverGroundTrue",
      "value": 2.971
    },
    {
      "path": "navigation.speedOverGround",
      "value": 3.85
    }
  ]
}
An update has a single source value and it applies to each of the values items.
In cases where you can get data from only a single source the source may be omitted and the receiver may fill it in when multiplexing data from several sources.A Signal K producer may not have access to a real time clock or UTC time.
In these cases timestamp should be omitted.
Elements in the Signal K processing chain, like a server receiving data from a producer, should fill in timestamp if it is missing in the incoming delta message.Each value item is then simply a pair of path and value.
The path must be a leaf path: it must be a path to a leaf the of the full model.
A leaf is where the actual value of the Signal K property is and where timestamp, $source and values properties are in the full model.
The value is often a scalar - a numeric value, as in the example above, but it can also be an object.
For example a navigation.position value would be an object like {"latitude": -41.2936935424, "longitude": 173.2470855712}.There are some static properties in the full model that lack the support for multiple values and metadata such as source and timestamp. An example is a vessel's name, directly under the vessel's root. This static data may appear in the delta stream, for example when received in AIS transmission. In this case the value should be the subtree of the full model, starting from the vessel's root, with just the relevant parts, and the path must be empty, indicating that the value should be merged to the full model mounted where the delta's context property points:{
  "context": "vessels.urn:mrn:imo:mmsi:2xxxxxxx",
  "updates": [
    {
      "source": {...},
      "timestamp": "2014-08-15T19:02:31.507Z",
      "values": [
        {
          "path": "",
          "value": {
            "name": "WRANGO"
          }
        }
      ]
    }
  ]
}
Data QualityData transmitted in Signal K format is assumed to be corrected for known sensor inaccuracies and miscellaneous required adjustments (like wind arrow offset), but there is no guarantee that data is accurate, or within certain bounds. Different sources will have different data quality and normal vigilance is always required.Missing or invalid dataA sensor or gateway/server may want to send a message indicating known invalid data or the fact that the sensor is functioning but can not provide data, for example when a depth sensor has no bottom fix. In this case the value must be JSON null in the delta message and the server must return the value as a json null in the REST api.Message IntegrityMany messaging systems specify checksums or other forms of message integrity checking. In Signal K we assume a reliable
transport will guarantee a valid message. This is true of TCP/IP and some other transports but not always the case. For
other transports (eg RS232 serial) a specific extended data format will apply, which is suited to that transport. Hence
at the message level no checksum or other tests need to be made.Encoding/DecodingThe JSON message format is supported across most programming environments and can be handled with any convenient library.On micro-controllers with limited RAM it is wise to read and write using streaming rather than hold the whole message in precious RAM.
There is an implementation of Signal K JSON streaming on an Arduino Mega (4K RAM) in the related Freeboard project.

data_model_multiple_values.html.body:
Multiple Values for a KeyThere are two use cases for multiple data:Multiple instances of a common device - eg two engines or multiple batteries

Multiple devices providing duplicate data - multiple values for the same Signal K key from different sensors, eg COG from both compass and gps or multiple depth sounders

Multiple instances of a common deviceSome parts of the Signal K schema are device oriented.For example in electrical domain you have the concept of multiple batteries. Each battery has multiple, common quantities like voltage, current and temperature. Here we have chosen to organise the Signal K data model hierarchy by instance: multiple batteries are represented as for example electrical.batteries.starter and electrical.batteries.house. Then underneath that prefix you have the different properties and quantities.This organisation allows a user interface to organise the individual readings in meaningful groups and you can query all the values related to that piece of equipment via REST API.It maintains the primary requirement that a given data value have a fixed and unique uri, but gives flexibility in the structure and complexities of data.The same device centric organisation is used in propulsion subschema, where the most common use case is having dual engine setup with propulsion.port and propulsion.starboard.The values starter, house, port and starboard are examples and not specified in the schema.
You are free to use application specific values within the regexp specified in the JSON schema.Multiple devices providing duplicate dataIt is quite possible for a key value to come from more than one device. eg position (lat/lon) could come from several gps enabled devices, and multiple depth sounders are not uncommon. We need a consistent way to handle this.All the incoming values may well be valid in their own context, and it is feasible that all of them may be wanted, for instance, displaying depth under each hull on a catamaran.Hence discarding or averaging values is not a solution, we must provide a way to store multiple values for a single measurement.Lets consider this for courseOverGroundTrueIf its the first value for the key, it becomes the default value and looks like this:{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundMagnetic": {
          "value": 3.615624078431453,
          "$source": "nmea2.II",
          "timestamp": "2017-03-04T14:58:48.000Z",
          "sentence": "VTG"
        }
      }
    }
  },
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.1.0",
  "sources": {
    "nmea2": {
      "label": "nmea2",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:48.000Z"
        }
      }
    }
  }
}
It has come from device sources.nmea2.II, where further details can be found.If another value with different source arrives, we add the values attribute with and values are in there - if its our preferred source (from persistent config) we auto-switch to it, otherwise we just record it. It look like this:{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundMagnetic": {
          "value": 3.615624078431453,
          "$source": "nmea2.II",
          "timestamp": "2017-03-04T14:58:48.000Z",
          "sentence": "VTG",
          "values": {
            "nmea1.II": {
              "value": 3.6376152270065814,
              "sentence": "VTG",
              "timestamp": "2017-03-04T14:58:47.000Z"
            },
            "nmea2.II": {
              "value": 3.615624078431453,
              "sentence": "VTG",
              "timestamp": "2017-03-04T14:58:48.000Z"
            }
          }
        }
      }
    }
  },
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.1.0",
  "sources": {
    "nmea1": {
      "label": "nmea1",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:47.000Z"
        }
      }
    },
    "nmea2": {
      "label": "nmea2",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:48.000Z"
        }
      }
    }
  }
}
Update messagesWhen a client subscribes to navigation.courseOverGroundMagnetic, they recieve all the values held. The update message does not include the values path, the case above looks like:{
  "context": "vessels.urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "updates": [
    {
      "source": {
        "label": "nmea2",
        "type": "NMEA0183",
        "talker": "II"
        }
      },
      "timestamp": "2017-03-04T14:58:48.000Z",
      "values": [
        {
          "path": "navigation.courseOverGroundMagnetic",
          "value": 3.615624078431453
        }
      ]
    },
    {
      "source": {
        "label": "nmea1",
        "type": "NMEA0183",
        "talker": "II"
        }
      },
      "timestamp": "2017-03-04T14:58:47.000Z",
      "values": [
        {
          "path": "navigation.courseOverGroundMagnetic",
          "value": 3.6376152270065814
        }
      ]
    }
  ]
}

Individual updates can be distinguished by their source.If a client wants only the values of a single source it should subscribe to a path that includes the full path under values including the source reference key of the source. The source reference should be enclosed in square brackets:  navigation.speedThroughWater.values[n2kFromFile.43]. The client can retrieve the relevant data via REST API.Note: The exact format of the update message is affected by the subscription policy. A policy of instant will result in changes being sent immediately, so typically one item in values per update. A policy of fixed will result in periodic updates which may contain many items in values.The update allows grouping values by source.

urls_etc.html.body:
Ports, Urls and VersioningShort Namesself refers to the current vessel. Normally used in vessels.self....

PortsThe Signal K HTTP and WebSocket services SHOULD be found on the usual HTTP/S ports (80 or 443). The services SHOULD be
found on the same port, but may be configured for independent ports and MAY be configured for ports other than HTTP/S.A Signal K server MAY offer Signal K over TCP or UDP, these services SHOULD be on port 55555[1].If an alternate port is needed it SHOULD be an arbitrary high port in the range 49152–65535[2].URL PrefixThe Signal K applications start from the /signalk root. This provides some protection against name collisions with
other applications on the same server. Therefore the Signal K entry point will always be found by loading
http(s)://«host»:«port»/signalk.VersioningThe version(s) of the Signal K API that a server supports SHALL be available as a JSON object available at /signalk:{
    "endpoints": {
        "v1": {
            "version": "1.1.2",
            "signalk-http": "http://192.168.1.2/signalk/v1/api/",
            "signalk-ws": "ws://192.168.1.2:34567/signalk/v1/stream"
        },
        "v3": {
            "version": "3.0",
            "signalk-http": "signalk/v3/api/",
            "signalk-ws": "ws://192.168.1.2/signalk/v3/stream",
            "signalk-tcp": "tcp://192.168.1.2:34568"
        }

    },
    "server": {
        "id": "signalk-node-server",
        "version": "0.1.21"
    }
}
This response is defined by the discovery.json schema. In this example, the server supports two versions of
the specification: 1.1.2 and 3.0. For each version, the server indicates which transport protocols it
supports and the URL that can be used to access that protocol's endpoint; in the example, the 1.1.2
REST endpoint is located at http://192.168.1.2/signalk/v1/api/. Clients should use one of these published
endpoints based on the protocol version they wish to use.The server must only return valid URLs and should use IANA standard protocol names such as http.
However, a server may support unofficial protocols and may return additional protocol names; for example,
the response above indicates the server supports a signalk-tcp stream over TCP at on port 34568.A server may return relative URIs that the client must resolve against the base of the original request.A server may return information about itself in the server property. The id and version scheme is not
defined as part of the specification and there is no registry for id values.

